import React from "react";
import axios from "axios";
import Link from "next/link";

class Mymainitems extends React.Component {
  static async getInitialProps() {
    var promise = axios
      .get("http://localhost:4000/mymainitems")
      .then(response => {
        return {
          hasErrored: false,
          mymainitemsData: response.data
        };
      })
      .catch(error => {
        return {
          hasErrored: true,
          message: error.message
        };
      });
    return promise;
  }

  constructor(props) {
    super(props);
    this.state = {
      hasErrored: props.hasErrored,
      message: props.message,
      mymainitemsData: props.mymainitemsData
    };
  }

  componentDidMount() {}

  componentWillUnmount() {}

  render() {
    return (
<div className="container dwi-div dwi-card">
  <div>
  <h5>Challenge #2</h5>
  </div>
  <div className="row">

    <div className="card-deck">
      <div className="card col-10 cardmin margintopbottom dwi-form-section">
      <p>  Zip Code  </p>
      <form>

        <div className="form-group row">
        <label htmlFor="inputzipcode" className="col-sm-2 col-form-label dwi-label">Zip Code</label>
          <div className="col-sm-10">
          <input type="text" name="zipcode" className="form-control" id="inputzipcode" placeholder="Zip Code" />
          </div>
        </div>
      </form>

      </div>
    </div>
  </div>
</div>

    );
  }
}

export default Mymainitems;
